	String countersAMAccountString = "";

	while ((it != null) && (it.hasNext())) {
		Identity id = it.next();
		countersAMAccount++;
		context.decache(id);
	}
		countersAMAccountString = countersAMAccount.toString();
		return countersAMAccountString;
	}

